import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import LoginUserPage from './LoginUserPage';
import HomePage from './HomePage';
import LoginAdminPage from './LoginAdminPage';
import AdminCRUDBanners from './AdminCRUDBanners';
import Samsaung from './Samsaung';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  const [userAuthenticated, setUserAuthenticated] = useState(false);
  const [adminAuthenticated, setAdminAuthenticated] = useState(false);

  const handleUserLogin = () => {
    setUserAuthenticated(true);
  };

  const handleAdminLogin = () => {
    setAdminAuthenticated(true);
  };

  return (
    <Router>
      <Routes>
        <Route path="/" element={<Navigate to="/userlogin" />} />
        <Route
          path="/userlogin"
          element={userAuthenticated ? <Navigate to="/homepage" /> : <LoginUserPage onLogin={handleUserLogin} />}
        />
        <Route path="/homepage" element={<HomePage onLogin={handleUserLogin} />} />
        <Route
          path="/adminlogin"
          element={adminAuthenticated ? <Navigate to="/homepage" /> : <LoginAdminPage AdminonLogin={handleAdminLogin} />}
        />
        <Route path="/adminpage" element={adminAuthenticated ? <AdminCRUDBanners /> : <Navigate to="/adminlogin" />} />
        <Route path="/samsaung" element={adminAuthenticated ? <Samsaung /> : <Navigate to="/userlogin" />} />
      </Routes>
    </Router>
  );
}

export default App;
